import React from "react";
import { Typography, AppBar, Link, Menu, Grid, Toolbar, Container, Tabs, Tab, Box, IconButton, Button } from '@material-ui/core'

import useStyles from "../styles";

const Tool = () => {

    return (
        <Grid container spacing={2} direction="row" >
            <Grid item xs={12}>
                <Box sx={{ width: '100%'}}/>
            </Grid>
            <Grid item xs={12}>
                <Container maxWidth="md">
                    <Typography variant="h2" align="center" color="textPrimary" gutterBottom>
                    ProMiSE tool information data
                    </Typography>
                </Container>
            </Grid>
            <Grid item xs={12}>
                <Divider p={5}/>
            </Grid>
        </Grid>
    );
}
export default Tool;
